// Nfts are purchaseable with Native

contract OxBulls is
    Initializable,
    OwnableUpgradeable,
    ReentrancyGuardUpgradeable,
    ProxyableUpgradeable,
    WithdrawableUpgradeable,
    ERC721BaseUpgradeable
{
    using StringsUpgradeable for uint256;

    address public artist; // artist address
    address public treasury; // address to receive payments

    bool public saleActive; // is sale active

    uint256 public maxPerWallet; // max nfts per wallet
    uint256 public maxSupply; // max nfts to be minted
    uint256 public paymentAmount; // price per nft

    event Buy(address indexed sender, uint256 indexed amount);
    event WithdrawRevenue(address indexed sender, uint256 indexed amount);

    error ExceedsMaxPerWallet();
    error ExceedsMaxSupply();
    error InsufficientPayment(uint256 sent, uint256 required);
    error SaleIsClosed();
    error TransferFailed();
    error ZeroAddress();

    modifier saleIsActive() {
        if (!saleActive) revert SaleIsClosed();
        _;
    }

    function initialize(
        string memory name,
        string memory symbol,
        address _treasury,
        uint256 _paymentAmount,
        uint256 _maxPerWallet,
        address _artist,
        string calldata tokenBaseURI
    ) public initializer notZeroAddress(_treasury) {
        treasury = _treasury;
        paymentAmount = _paymentAmount;
        _tokenBaseURI = tokenBaseURI;
        artist = _artist;
        OwnableUpgradeable.__Ownable_init();
        ERC721BaseUpgradeable.__ERC721BaseUpgradeable_init(name, symbol);
        maxSupply = 530;
        maxPerWallet = _maxPerWallet;
    }

    receive() external payable onlyOwner {}

    function buy(uint256 amount) external payable saleIsActive nonReentrant {
        if (totalSupply + amount > maxSupply) revert ExceedsMaxSupply();
        if (balanceOf(_msgSender()) + amount > maxPerWallet)
            revert ExceedsMaxPerWallet();
        uint256 requiredAmount = paymentAmount * amount;
        _checkSufficientNativePayment(requiredAmount);
        _sendToArtist(requiredAmount);
        emit Buy(_msgSender(), amount);
        _batchMint(_msgSender(), amount);
    }

    function burn(uint32 tokenId) external {
        _burn(tokenId);
    }

    function buyOne() external payable saleIsActive nonReentrant {
        if (totalSupply + 1 > maxSupply) revert ExceedsMaxSupply();
        if (balanceOf(_msgSender()) == maxPerWallet)
            revert ExceedsMaxPerWallet();
        _checkSufficientNativePayment(paymentAmount);
        _sendToArtist(paymentAmount);
        emit Buy(_msgSender(), 1);
        _mint(_msgSender());
    }

    function mint(address receiver) external onlyProxy {
        _mint(receiver);
    }

    function mint(address[] calldata receivers) external onlyProxy {
        for (uint256 i; i < receivers.length; ) {
            _mint(receivers[i]);
            unchecked {
                ++i;
            }
        }
    }

    function setArtist(
        address _artist
    ) external onlyOwner notZeroAddress(_artist) {
        artist = _artist;
    }

    function setMaxPerWallet(uint256 value) external onlyOwner {
        maxPerWallet = value;
    }

    function setMaxSupply(uint256 value) external onlyOwner {
        maxSupply = value;
    }

    function setPaymentAmount(uint256 value) external onlyOwner {
        paymentAmount = value;
    }

    function setSaleActive(bool value) external onlyOwner {
        saleActive = value;
    }

    function setTreasury(
        address _treasury
    ) external onlyOwner notZeroAddress(_treasury) {
        treasury = _treasury;
    }

    function tokenURI(
        uint256 tokenId
    ) external view virtual override returns (string memory) {
        if (!_exists(tokenId)) revert NonexistentToken(tokenId);
        return string(abi.encodePacked(_tokenBaseURI, tokenId.toString(), ".json"));
    }

    function updateConfig(
        bool _saleActive,
        string calldata tokenBaseURI //,
    ) external onlyOwner {
        saleActive = _saleActive;
        _tokenBaseURI = tokenBaseURI;
    }

    function withdrawNativeToTreasury() external onlyOwner {
        _withdrawNativeToTreasury(treasury);
    }

    function withdrawTokensToTreasury(address tokenAddress) external onlyOwner {
        _withdrawTokensToTreasury(treasury, tokenAddress);
    }

    function batchSafeTransferFromSmallInt(
        address from,
        address to,
        uint32[] memory tokenIds,
        bytes memory data
    ) public {
        for (uint32 i; i < tokenIds.length; ) {
            safeTransferFrom(from, to, tokenIds[i], data);
            unchecked {
                ++i;
            }
        }
    }

    function batchTransferFromSmallInt(
        address from,
        address to,
        uint32[] memory tokenIds
    ) public {
        for (uint32 i; i < tokenIds.length; ) {
            transferFrom(from, to, tokenIds[i]);
            unchecked {
                ++i;
            }
        }
    }

    function isApprovedForAll(
        address _owner,
        address operator
    ) public view override returns (bool) {
        return
            proxyToApproved[operator] ||
            super.isApprovedForAll(_owner, operator);
    }

    function _checkSufficientNativePayment(uint256 amount) private view {
        if (amount != msg.value)
            revert InsufficientPayment({sent: msg.value, required: amount});
    }

    function _sendToArtist(uint256 amount) private {
        amount = amount / 5;
        (bool success, ) = artist.call{value: amount}("");
        if (!success) revert TransferFailed();
    }
}
"
    },
    "contracts/utils/ERC721BaseUpgradeable.sol": {
      "content": "//SPDX-License-Identifier: MIT
pragma solidity 0.8.19;

import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/utils/StringsUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "./ERC721MinUpgradeable.sol";

abstract contract ERC721BaseUpgradeable is
    Initializable,
    OwnableUpgradeable,
    ERC721MinUpgradeable
{
    using StringsUpgradeable for uint256;

    string internal _contractURI;
    string internal _tokenBaseURI; // metadata URI
    mapping(uint32 => string) public tokenURIs; // individual/unique metadata per token

    error TransferOfTokenThatIsNotOwn();
    error InconsistentArrayLengths(uint array1, uint array2);
    error AddressIsZero();

    function __ERC721BaseUpgradeable_init(
        string memory _name,
        string memory _symbol
    ) internal onlyInitializing {
        __ERC721BaseUpgradeable_init_unchained(_name, _symbol);
    }

    function __ERC721BaseUpgradeable_init_unchained(
        string memory _name,
        string memory _symbol
    ) internal onlyInitializing {
        __ERC721MinUpgradeable_init(_name, _symbol);
        OwnableUpgradeable.__Ownable_init();
    }

    modifier consistentArrayLengths(uint arrayLength1, uint arrayLength2) {
        if (arrayLength1 != arrayLength2)
            revert InconsistentArrayLengths({
                array1: arrayLength1,
                array2: arrayLength2
            });
        _;
    }

    modifier notZeroAddress(address _address) {
        if (_address == address(0)) revert AddressIsZero();
        _;
    }

    modifier senderOwnsToken(uint32 id) {
        if (ownerOf(id) != _msgSender()) revert TransferOfTokenThatIsNotOwn();
        _;
    }

    modifier senderOwnsTokens(uint32[] calldata ids) {
        if (!isOwnerOf(_msgSender(), ids)) revert TransferOfTokenThatIsNotOwn();
        _;
    }

    // mint Nfts to a list of receivers, assigning an Nft type to each minted Nft
    function _airdrop(address[] calldata receivers) internal virtual onlyOwner {
        for (uint256 i; i < receivers.length; i++) {
            _mint(receivers[i]);
        }
    }

    // mint Nfts to single receiver
    function _batchMint(address receiver, uint256 amount) internal {
        for (uint256 i; i < amount; i++) {
            _mint(receiver);
        }
    }

    function setBaseURI(string calldata uri) external onlyOwner {
        _tokenBaseURI = uri;
    }

    function setContractURI(string calldata uri) external onlyOwner {
        _contractURI = uri;
    }

    function setTokenURI(uint32 tokenId, string calldata uri)
        external
        onlyOwner
    {
        tokenURIs[tokenId] = uri;
    }

    // returns specific tokenURI is one is assigned to the token
    // if not, then returns URI for Nft type using tokenBaseURI
    function tokenURI(uint256 tokenId)
        external
        view
        virtual
        override
        returns (string memory)
    {
        if (!_exists(tokenId)) revert NonexistentToken(tokenId);
        if (bytes(tokenURIs[uint32(tokenId)]).length != 0)
            return tokenURIs[uint32(tokenId)];
        return string(abi.encodePacked(_tokenBaseURI, tokenId.toString()));
    }

    function contractURI() public view returns (string memory) {
        return _contractURI;
    }

    function isOwnerOf(address account, uint32[] calldata tokenIds)
        public
        view
        returns (bool)
    {
        for (uint256 i; i < tokenIds.length; i++) {
            if (_owners[tokenIds[i]] != account) return false;
        }
        return true;
    }
}
"
    },
    "contracts/utils/ERC721MinUpgradeable.sol": {
      "content": "// SPDX-License-Identifier: MIT
pragma solidity 0.8.19;

import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/utils/introspection/ERC165Upgradeable.sol";
import "@openzeppelin/contracts-upgradeable/utils/introspection/IERC165Upgradeable.sol";
import "@openzeppelin/contracts-upgradeable/utils/ContextUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/token/ERC721/IERC721Upgradeable.sol";
import "@openzeppelin/contracts-upgradeable/token/ERC721/IERC721ReceiverUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/token/ERC721/extensions/IERC721MetadataUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/utils/AddressUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/utils/StringsUpgradeable.sol";

/*
ERC721 implementation optimized for minting.
Assumes tokenIds are sequentially minted (0, 1, 2, 3..). 
*/

abstract contract ERC721MinUpgradeable is
    Initializable,
    ContextUpgradeable,
    ERC165Upgradeable,
    IERC721Upgradeable,
    IERC721MetadataUpgradeable
{
    using AddressUpgradeable for address;
    using StringsUpgradeable for uint256;

    // Token name
    string private _name;

    // Token symbol
    string private _symbol;

    // Array of token owners. Array index is token Id
    address[] internal _owners;

    // Mapping owner address to token count
    mapping(address => uint32) internal _balances;

    // Mapping from token ID to approved address
    mapping(uint32 => address) private _tokenApprovals;

    // Mapping from owner to operator approvals
    mapping(address => mapping(address => bool)) private _operatorApprovals;

    // amount of tokens in existence
    uint256 public totalSupply;

    error NonexistentToken(uint tokenId);

    /**
     * @dev Initializes the contract by setting a `name` and a `symbol` to the token collection.
     */
    function __ERC721MinUpgradeable_init(
        string memory name_,
        string memory symbol_
    ) internal onlyInitializing {
        __ERC721MinUpgradeable_init_unchained(name_, symbol_);
    }

    function __ERC721MinUpgradeable_init_unchained(
        string memory name_,
        string memory symbol_
    ) internal onlyInitializing {
        _name = name_;
        _symbol = symbol_;
    }

    function getOwnerCount() external view returns (uint256) {
        return _owners.length;
    }

    /**
     * @dev See {IERC721Metadata-tokenURI}.
     */
    function tokenURI(uint256 tokenId)
        external
        view
        virtual
        override
        returns (string memory)
    {
        _checkIfTokenExists(tokenId);
        string memory baseURI = _baseURI();
        return
            bytes(baseURI).length > 0
                ? string(abi.encodePacked(baseURI, tokenId.toString()))
                : "";
    }

    function _checkIfTokenExists(uint256 tokenId) internal view {
        if (!_exists(tokenId)) revert NonexistentToken(tokenId);
    }

    /**
     * @dev Base URI for computing {tokenURI}. If set, the resulting URI for each
     * token will be the concatenation of the `baseURI` and the `tokenId`. Empty
     * by default, can be overridden in child contracts.
     */
    function _baseURI() internal view virtual returns (string memory) {
        return "";
    }

    /**
     * @dev See {IERC165-supportsInterface}.
     */
    function supportsInterface(bytes4 interfaceId)
        public
        view
        virtual
        override(ERC165Upgradeable, IERC165Upgradeable)
        returns (bool)
    {
        return
            interfaceId == type(IERC721Upgradeable).interfaceId ||
            interfaceId == type(IERC721MetadataUpgradeable).interfaceId ||
            super.supportsInterface(interfaceId);
    }

    /**
     * @dev See {IERC721-balanceOf}.
     */
    function balanceOf(address owner)
        public
        view
        virtual
        override
        returns (uint256)
    {
        if (owner == address(0)) revert QueryForZeroAddress();
        return _balances[owner];
    }

    error QueryForZeroAddress();

    /**
     * @dev See {IERC721-ownerOf}.
     */
    function ownerOf(uint256 tokenId)
        public
        view
        virtual
        override
        returns (address)
    {
        address owner = _owners[tokenId];
        _checkIfTokenExists(tokenId);
        return owner;
    }

    /**
     * @dev See {IERC721Metadata-name}.
     */
    function name() public view virtual override returns (string memory) {
        return _name;
    }

    /**
     * @dev See {IERC721Metadata-symbol}.
     */
    function symbol() public view virtual override returns (string memory) {
        return _symbol;
    }

    /**
     * @dev See {IERC721-approve}.
     */
    function approve(address to, uint256 tokenId) public virtual override {
        address owner = ownerOf(tokenId);
        if (to == owner)
            revert ApprovalToCurrentOwner({_to: to, _owner: owner});
        if (_msgSender() != owner && !isApprovedForAll(owner, _msgSender()))
            revert ApprovalCallerIsNotOwnerNorApproved({
                caller: _msgSender(),
                _owner: owner
            });
        _approve(to, tokenId);
    }

    error ApprovalToCurrentOwner(address _to, address _owner);
    error ApprovalCallerIsNotOwnerNorApproved(address caller, address _owner);
    error ApproveToCaller(address _operator, address caller);
    error TransferCallsIsNotOwnerNorApproved(address caller, address _owner);

    /**
     * @dev See {IERC721-getApproved}.
     */
    function getApproved(uint256 tokenId)
        public
        view
        virtual
        override
        returns (address)
    {
        _checkIfTokenExists(tokenId);
        return _tokenApprovals[uint32(tokenId)];
    }

    /**
     * @dev See {IERC721-setApprovalForAll}.
     */
    function setApprovalForAll(address operator, bool approved)
        public
        virtual
        override
    {
        if (operator == _msgSender())
            revert ApproveToCaller({_operator: operator, caller: _msgSender()});
        _operatorApprovals[_msgSender()][operator] = approved;
        emit ApprovalForAll(_msgSender(), operator, approved);
    }

    /**
     * @dev See {IERC721-isApprovedForAll}.
     */
    function isApprovedForAll(address owner, address operator)
        public
        view
        virtual
        override
        returns (bool)
    {
        return _operatorApprovals[owner][operator];
    }

    /**
     * @dev See {IERC721-transferFrom}.
     */
    function transferFrom(
        address from,
        address to,
        uint256 tokenId
    ) public virtual override {
        if (!_isApprovedOrOwner(_msgSender(), tokenId))
            revert TransferCallsIsNotOwnerNorApproved({
                caller: _msgSender(),
                _owner: _owners[tokenId]
            });
        _transfer(from, to, tokenId);
    }

    /**
     * @dev See {IERC721-safeTransferFrom}.
     */
    function safeTransferFrom(
        address from,
        address to,
        uint256 tokenId
    ) public virtual override {
        safeTransferFrom(from, to, tokenId, "");
    }

    /**
     * @dev See {IERC721-safeTransferFrom}.
     */
    function safeTransferFrom(
        address from,
        address to,
        uint256 tokenId,
        bytes memory data
    ) public virtual override {
        if (!_isApprovedOrOwner(_msgSender(), tokenId))
            revert TransferCallsIsNotOwnerNorApproved({
                caller: _msgSender(),
                _owner: _owners[tokenId]
            });
        _safeTransfer(from, to, tokenId, data);
    }

    function batchTransferFrom(
        address from,
        address to,
        uint256[] memory tokenIds
    ) public virtual {
        for (uint256 i; i < tokenIds.length; i++) {
            transferFrom(from, to, tokenIds[i]);
        }
    }

    function batchSafeTransferFrom(
        address from,
        address to,
        uint256[] memory tokenIds,
        bytes memory data
    ) public virtual {
        for (uint256 i; i < tokenIds.length; i++) {
            safeTransferFrom(from, to, tokenIds[i], data);
        }
    }

    /**
     * @dev Safely transfers `tokenId` token from `from` to `to`, checking first that contract recipients
     * are aware of the ERC721 protocol to prevent tokens from being forever locked.
     *
     * `_data` is additional data, it has no specified format and it is sent in call to `to`.
     *
     * This internal function is equivalent to {safeTransferFrom}, and can be used to e.g.
     * implement alternative mechanisms to perform token transfer, such as signature-based.
     *
     * Requirements:
     *
     * - `from` cannot be the zero address.
     * - `to` cannot be the zero address.
     * - `tokenId` token must exist and be owned by `from`.
     * - If `to` refers to a smart contract, it must implement {IERC721Receiver-onERC721Received}, which is called upon a safe transfer.
     *
     * Emits a {Transfer} event.
     */
    function _safeTransfer(
        address from,
        address to,
        uint256 tokenId,
        bytes memory data
    ) internal virtual {
        _transfer(from, to, tokenId);
        require(
            _checkOnERC721Received(from, to, tokenId, data),
            "ERC721: transfer to non ERC721Receiver implementer"
        );
    }

    /**
     * @dev Returns whether `tokenId` exists.
     *
     * Tokens can be managed by their owner or approved accounts via {approve} or {setApprovalForAll}.
     *
     * Tokens start existing when they are minted (`_mint`),
     * and stop existing when they are burned (`_burn`).
     */
    function _exists(uint256 tokenId) internal view virtual returns (bool) {
        return tokenId < _owners.length && _owners[tokenId] != address(0);
    }

    /**
     * @dev Returns whether `spender` is allowed to manage `tokenId`.
     *
     * Requirements:
     *
     * - `tokenId` must exist.
     */
    function _isApprovedOrOwner(address spender, uint256 tokenId)
        internal
        view
        virtual
        returns (bool)
    {
        _checkIfTokenExists(tokenId);
        address owner = ownerOf(tokenId);
        return (spender == owner ||
            getApproved(tokenId) == spender ||
            isApprovedForAll(owner, spender));
    }

    /**
     * @dev Safely mints and transfers tokenId to `to`.
     *
     * Requirements:
     *
     * - If `to` refers to a smart contract, it must implement {IERC721Receiver-onERC721Received}, which is called upon a safe transfer.
     *
     * Emits a {Transfer} event.
     */
    function _safeMint(address to) internal virtual {
        _safeMint(to, "");
    }

    /**
     * @dev Same as {xref-ERC721-_safeMint-address-}[`_safeMint`], with an additional `data` parameter which is
     * forwarded in {IERC721Receiver-onERC721Received} to contract recipients.
     */
    function _safeMint(address to, bytes memory _data) internal virtual {
        _mint(to);
        require(
            _checkOnERC721Received(address(0), to, _owners.length - 1, _data),
            "ERC721: transfer to non ERC721Receiver implementer"
        );
    }

    /**
     * @dev Mints tokenId and transfers it to `to`.
     *
     * WARNING: Usage of this method is discouraged, use {_safeMint} whenever possible
     *
     * Requirements:
     *
     * - `to` cannot be the zero address.
     *
     * Emits a {Transfer} event.
     */
    function _mint(address to) internal virtual {
        require(to != address(0), "ERC721: mint to the zero address");
        _owners.push(to);
        _balances[to]++;
        totalSupply++;
        emit Transfer(address(0), to, _owners.length - 1);
    }

    function _mintToSender() internal virtual {
        _owners.push(_msgSender());
        _balances[_msgSender()]++;
        totalSupply++;
        emit Transfer(address(0), _msgSender(), _owners.length - 1);
    }

    /**
     * @dev Destroys `tokenId`.
     * The approval is cleared when the token is burned.
     *
     * Requirements:
     *
     * - `tokenId` must exist.
     *
     * Emits a {Transfer} event.
     */
    function _burn(uint256 tokenId) internal virtual {
        address owner = ownerOf(tokenId);

        _beforeTokenTransfer(owner, address(0), tokenId);

        // Clear approvals
        _approve(address(0), tokenId);
        _owners[tokenId] = address(0);
        _balances[owner]--;
        totalSupply--;
        emit Transfer(owner, address(0), tokenId);
    }

    /**
     * @dev Moves `tokenId` tokens from the caller's account to `to`.
     *
     * Returns a boolean value indicating whether the operation succeeded.
     *
     * Emits a {Transfer} event.
     */
    function transfer(address to, uint256 tokenId)
        public
        virtual
        returns (bool)
    {
        _transfer(_msgSender(), to, tokenId);
        return true;
    }

    /**
     * @dev Transfers `tokenId` from `from` to `to`.
     *  As opposed to {transferFrom}, this imposes no restrictions on msg.sender.
     *
     * Requirements:
     *
     * - `to` cannot be the zero address.
     * - `tokenId` token must be owned by `from`.
     *
     * Emits a {Transfer} event.
     */
    function _transfer(
        address from,
        address to,
        uint256 tokenId
    ) internal virtual {
        require(
            ownerOf(tokenId) == from,
            "ERC721: transfer of token that is not own"
        );
        require(to != address(0), "ERC721: transfer to the zero address");
        _beforeTokenTransfer(from, to, tokenId);

        // Clear approvals from the previous owner
        _approve(address(0), tokenId);
        _balances[from]--;
        _balances[to]++;
        _owners[tokenId] = to;

        emit Transfer(from, to, tokenId);
    }

    /**
     * @dev Approve `to` to operate on `tokenId`
     *
     * Emits a {Approval} event.
     */
    function _approve(address to, uint256 tokenId) internal virtual {
        _tokenApprovals[uint32(tokenId)] = to;
        emit Approval(ownerOf(tokenId), to, tokenId);
    }

    /**
     * @dev Internal function to invoke {IERC721Receiver-onERC721Received} on a target address.
     * The call is not executed if the target address is not a contract.
     *
     * @param from address representing the previous owner of the given token ID
     * @param to target address that will receive the tokens
     * @param tokenId uint256 ID of the token to be transferred
     * @param data bytes optional data to send along with the call
     * @return bool whether the call correctly returned the expected magic value
     */
    function _checkOnERC721Received(
        address from,
        address to,
        uint256 tokenId,
        bytes memory data
    ) private returns (bool) {
        if (to.isContract()) {
            try
                IERC721ReceiverUpgradeable(to).onERC721Received(
                    _msgSender(),
                    from,
                    tokenId,
                    data
                )
            returns (bytes4 retval) {
                return
                    retval ==
                    IERC721ReceiverUpgradeable.onERC721Received.selector;
            } catch (bytes memory reason) {
                if (reason.length == 0) {
                    revert(
                        "ERC721: transfer to non ERC721Receiver implementer"
                    );
                } else {
                    assembly {
                        revert(add(32, reason), mload(reason))
                    }
                }
            }
        } else {
            return true;
        }
    }

    /**
     * @dev Hook that is called before any token transfer. This includes minting
     * and burning.
     *
     * Calling conditions:
     *
     * - When `from` and `to` are both non-zero, ``from``'s `tokenId` will be
     * transferred to `to`.
     * - When `from` is zero, `tokenId` will be minted for `to`.
     * - When `to` is zero, ``from``'s `tokenId` will be burned.
     * - `from` and `to` are never both zero.
     *
     * To learn more about hooks, head to xref:ROOT:extending-contracts.adoc#using-hooks[Using Hooks].
     */
    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 tokenId
    ) internal virtual {}

    function tokenOfOwnerByIndex(address account, uint256 index)
        public
        view
        returns (uint256)
    {
        uint256 foundCount;
        for (uint256 i; i < _owners.length; ++i) {
            if (_owners[i] == account) {
                if (foundCount == index) return i;
                foundCount++;
            }
        }
        require(foundCount > 0, "NONE_FOUND");
        revert("OUT_OF_INDEX");
    }
}
"
    },
    "contracts/utils/ProxyableUpgradeable.sol": {
      "content": "//SPDX-License-Identifier: MIT
pragma solidity 0.8.19;

import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "hardhat/console.sol";

abstract contract ProxyableUpgradeable is Initializable, OwnableUpgradeable {
    mapping(address => bool) public proxyToApproved; // proxy allowance for interaction with future contract

    modifier onlyProxy() {
        require(proxyToApproved[_msgSender()], "Only proxy");
        _;
